import {Grid, Cell} from 'react-mdl';

class About extends Component{
    render(){
        return(
            <div className="">
                <Grid>
                    <Cell col={4}>
                        Left Side
                    </Cell>
                    <Cell col={4}>
                        Rigth Side
                    </Cell>
                </Grid>

            </div>
        )
    }
}

export default About;
